import React from 'react';

const Cards = ({ data: { confirmed, recovered, deaths, lastUpdate } }) => {
    //console.log(confirmed);
    if(!confirmed){
        return('loadding...');
    }

    return (

        <div className="app">
            {confirmed}
        </div>
    )
}

export default Cards;
